declare type IECompatibleWindow = Window & {
    document: Document & {
        frames?: {
            devicePixelRatio: number;
            screen: {
                deviceXDPI: number;
                systemXDPI: number;
            };
        };
    };
};
declare function zoomLevel(win?: IECompatibleWindow): number;
declare function elementZoomLevel(element: HTMLElement, elementStyles?: CSSStyleDeclaration, win?: IECompatibleWindow): number;
export { zoomLevel as default, zoomLevel, elementZoomLevel };
